		<!-- 图片弹出层HTML结构 -->
		<div id="imageModal" class="image-modal">
			<div class="image-modal-content">
				<span class="image-modal-close" onclick="closeImageModal()">&times;</span>
				<div class="zoom-info" id="zoomInfo">100%</div>
				<img id="modalImage" src="" alt="放大图片">
				<div class="image-controls">

						</svg>
						缩小
					</button>
					<button class="image-control-btn" onclick="zoomIn()" id="zoomInBtn">
						<svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
							<path d="M19 13h-6v6h-2v-6H5v-2h6V5h2v6h6v2z"/>
						</svg>
						放大
					</button>
					<button class="image-control-btn" onclick="resetZoom()">
						<svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
							<path d="M12 2C6.48 2 2 6.48 2 12s4.48 10 10 10 10-4.48 10-10S17.52 2 12 2zm-2 15l-5-5 1.41-1.41L10 14.17l7.59-7.59L19 8l-9 9z"/>
						</svg>
						重置
					</button>
					<button class="image-control-btn" onclick="downloadImage()">
						<svg width="16" height="16" viewBox="0 0 24 24" fill="currentColor">
							<path d="M19 9h-4V3H9v6H5l7 7 7-7zM5 18v2h14v-2H5z"/>
						</svg>
						下载

		<!-- 图片弹出层JavaScript -->
		<script>
			let currentZoom = 1;
			let currentImageSrc = '';
			
			// 打开图片弹出层
			function openImageModal(imageSrc) {
				const modal = document.getElementById('imageModal');
				const modalImage = document.getElementById('modalImage');
				const zoomInfo = document.getElementById('zoomInfo');
				
				currentImageSrc = imageSrc;
				currentZoom = 1;
				
				modalImage.src = imageSrc;
				modalImage.style.transform = `scale(${currentZoom})`;
				zoomInfo.textContent = Math.round(currentZoom * 100) + '%';
				
				modal.style.display = 'block';
				document.body.style.overflow = 'hidden'; // 防止背景滚动
				
				updateZoomButtons();
			}
			
			// 关闭图片弹出层
			function closeImageModal() {
				const modal = document.getElementById('imageModal');
				modal.style.display = 'none';
				document.body.style.overflow = 'auto'; // 恢复背景滚动
			}
			
			// 放大图片
			function zoomIn() {
				if (currentZoom < 3) {
					currentZoom += 0.2;
					updateImageZoom();
				}
			}
			
			// 缩小图片
			function zoomOut() {
				if (currentZoom > 0.3) {
					currentZoom -= 0.2;
					updateImageZoom();
				}
			}
			
			// 重置缩放
			function resetZoom() {
				currentZoom = 1;
				updateImageZoom();
			}
			
			// 更新图片缩放
			function updateImageZoom() {
				const modalImage = document.getElementById('modalImage');
				const zoomInfo = document.getElementById('zoomInfo');
				
				modalImage.style.transform = `scale(${currentZoom})`;
				zoomInfo.textContent = Math.round(currentZoom * 100) + '%';
				
				updateZoomButtons();
			}
			
			// 更新缩放按钮状态
			function updateZoomButtons() {
				const zoomOutBtn = document.getElementById('zoomOutBtn');
				const zoomInBtn = document.getElementById('zoomInBtn');
				
				zoomOutBtn.disabled = currentZoom <= 0.3;
				zoomInBtn.disabled = currentZoom >= 3;
			}
			
			// 下载图片
			function downloadImage() {
				if (!currentImageSrc) return;
				
				const link = document.createElement('a');
				link.href = currentImageSrc;
				link.download = 'image_' + Date.now() + '.jpg';
				document.body.appendChild(link);
				link.click();
				document.body.removeChild(link);
			}
			
			// 键盘快捷键支持
			document.addEventListener('keydown', function(e) {
				const modal = document.getElementById('imageModal');
				if (modal.style.display === 'block') {
					switch(e.key) {
						case 'Escape':
							closeImageModal();
							break;
						case '+':
						case '=':
							e.preventDefault();
							zoomIn();
							break;
						case '-':
							e.preventDefault();
							zoomOut();
							break;
						case '0':
							resetZoom();
							break;
					}
				}
			});
			
			// 点击背景关闭弹出层
			document.getElementById('imageModal').addEventListener('click', function(e) {
				if (e.target === this) {
					closeImageModal();
				}
			});
			
			// 为所有图片添加点击事件
			document.addEventListener('DOMContentLoaded', function() {
				const images = document.querySelectorAll('.img-container img');
				images.forEach(img => {
					img.addEventListener('click', function() {
						openImageModal(this.src);
					});
				});
			});
		</script>
